import React from "react";
import ExpItem from "./ExpenseItem";

const ExpList = () => {
    const expenses = [
        { id:0, name:'shopping', cost:50 },
        { id:1, name:'cooking', cost:50 },
        { id:2, name:'washing', cost:50 },
        { id:3, name:'cleaning', cost:50 },
        { id:4, name:'woeking', cost:50 }
    ]

    return (
        <ul>
            {expenses.map((expense) => (
                <ExpItem id={expense.id} name={expense.name} cost={expense.cost} />
            ))}
        </ul>
    )
}

export default ExpList;
